import React from "react";
import {Table,Space,Tag} from 'antd'
export default class UserList extends React.Component{
    render() {

        const columns = [
            {
                title: '用户名',
                dataIndex: 'userName',
                key: 'userName',
            },
            {
                title: '邮箱',
                dataIndex: 'email',
                key: 'email',
            },
            {
                title: '手机',
                dataIndex: 'phone',
                key: 'phone',
            },
            {
                title: '个人介绍',
                key: 'jieshao',
                dataIndex: 'jieshao',
            },
            {
                title: '类型',
                dataIndex: 'leixing',
                key: 'leixing',
            },
            {
                title: '创建时间',
                dataIndex: 'cTime',
                key: 'cTime',
            },
            {
                title: '操作',
                dataIndex: 'caozuo',
                key: 'caozuo',
            },
        ];

        const data = [
            {
                key: '1',
                userName:'耿哥',
                email: '123@qq.com',
                phone: 12345678912,
                jieshao: '你好',
                leixing:'人才',
                cTime:'2018-8-8',
                caozuo:'删除',
            },
        ];

        return (
            <Table columns={columns} dataSource={data} />
        );
    }
}
